import { HttpClient, HttpContext, HttpResponse } from '@angular/common/http';
import { Observable } from 'rxjs';
import { filter, map } from 'rxjs/operators';
import { StrictHttpResponse } from '../../strict-http-response';
import { RequestBuilder } from '../../request-builder';

import { OrderItemDto } from '../../models/order-item-dto';

export interface CreateOrderItemOrder$Params {
      body?: OrderItemDto
}

export function createOrderItemOrder(http: HttpClient, rootUrl: string, params?: CreateOrderItemOrder$Params, context?: HttpContext): Observable<StrictHttpResponse<OrderItemDto>> {
  const rb = new RequestBuilder(rootUrl, createOrderItemOrder.PATH, 'post');
  if (params) {
    rb.body(params.body, 'application/*+json');
  }

  return http.request(
    rb.build({ responseType: 'json', accept: 'text/json', context })
  ).pipe(
    filter((r: any): r is HttpResponse<any> => r instanceof HttpResponse),
    map((r: HttpResponse<any>) => {
      return r as StrictHttpResponse<OrderItemDto>;
    })
  );
}

createOrderItemOrder.PATH = '/Order/items';
